    false,nt"url": null,nt"notes": "This narrative report for Erie National
    Wildlife Refuge outlines Refuge accomplishments for the 1997 calendar year. The
    report begins by giving a brief introduction to the Refuge and describing the climate
    and habitat conditions in the Refuge, as well as land acquisition. The planning
    section discusses the management plan and research and investigations. The administration
    section discusses personnel, youth programs, other manpower programs, volunteer
    programs, funding, safety, and the North American Waterfowl Management Plan. The
    habitat management section discusses wetlands, forests, croplands, grasslands, grazing,
    fire management, and pest control. Wildlife- including wildlife diversity, endangered
    and threatened species, waterfowl, marsh birds and water birds, shorebirds, raptors,
    other migratory birds, game mammals, other resident wildlife, fisheries resources,
    wildlife propagation and stocking, and animal control- are discussed. The public
    relations sections describes outdoor classrooms, information and interpretation,
    hunting, fishing, trapping, wildlife observation, other wildlife oriented recreation,
    picnicking, and law enforcement. The construction and maintenance section describes
    recent new construction, rehabilitation, equipment utilization and replacement,
    and computer systems. Cooperative programs and items of interest are discussed.
    Photographs and Refuge brochures are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
